import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';


function Contact() {
  return (
    <section className="py-5" style={{ backgroundColor: '#2A2A2D' }}>
      <div className="container text-center">
        <h2 className="display-4 text-orange mb-4">Contact Me</h2>
        <p className="text-white">Feel free to reach out for collaborations, job opportunities, or just to say hi!</p>
        <a href="mailto:your-email@example.com" className="btn btn-primary mt-3">Email Me</a>
        <a href="mailto:your-email@example.com" className="text-white mx-2">
        <FontAwesomeIcon icon={faEnvelope} size="2x" />
        </a>
        <a href="https://linkedin.com/in/your-profile" className="text-white mx-2">
        <FontAwesomeIcon icon={faLinkedin} size="2x" />
        </a>
        <a href="https://github.com/your-github" className="text-white mx-2">
        <FontAwesomeIcon icon={faGithub} size="2x" />
        </a>

      </div>
    </section>
  );
}

export default Contact;
